public class if_else_statements {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		// else stmts print out only when the condition is false
		
		int marks = 64;
		
		if(marks > 65) {
			
			System.out.println("pass");
			
		}
		else {
			System.out.println("fail");
			
			
		}
		
		
		

	}

}
